import "./main.scss";
import About from "../../component/section-about/About";
import Experience from "../../component/section-skill/Experience";
import Skill from "../../component/section-skill/Skill";

export default function Main() {
  return (
    <div className="Main">
      <About />
      <Experience />
      <Skill />
    </div>
  );
}
